import array
import gzip
import base64

int32 = "l" if array.array("l").itemsize == 4 else "i"  # 環境によって異なる


bases = b""
bases = base64.b64decode(bases)
bases = gzip.decompress(bases)
bases = array.array(int32, bases)
assert len(bases) == 16384


def _isSPRP(n: int, a: int) -> bool:
    if n == a:
        return True
    if n % a == 0:
        return False
    d = m1 = n - 1
    s = (d & -d).bit_length() - 1
    d >>= s
    cur = pow(a, d, n)
    if cur == 1:
        return True
    for _ in range(s):
        if cur == m1:
            return True
        cur = cur * cur % n
    return False


def isPrime(x: int) -> bool:
    # Fast Primality Testing for Integers That Fit into a Machine Word
    # http://ceur-ws.org/Vol-1326/020-Forisek.pdf
    if x in [2, 3, 5, 7]:
        return True
    if x % 2 == 0 or x % 3 == 0 or x % 5 == 0 or x % 7 == 0:
        return False
    if x < 121:
        return x > 1
    if not _isSPRP(x, 2):
        return False
    h = ((x >> 32) ^ x) * 0x45D9F3B3335B369 & 0xFFFFFFFFFFFFFFFF
    h = ((h >> 32) ^ h) * 0x3335B36945D9F3B & 0xFFFFFFFFFFFFFFFF
    h = (h >> 32) ^ h
    b = bases[h & 16383]
    return _isSPRP(x, b & 4095) and _isSPRP(x, b >> 12)
